    form.get('Childbirth Plan').setHidden(true);
    form.get('Planned place of delivery set').setHidden(true);
    form.get('Pregnancy Risks').setHidden(true);
    form.get('Other Pregnancy Risks').setHidden(true);
    form.get('Other Signs and Symptoms', 0).setHidden(true);
  } else if (form.get('First Visit').getValue() === 'Yes') {
    form.get('Number of Pregnancies').setHidden(false);
    form.get('Number of Term Pregnancies').setHidden(false);
    form.get('Number of live births').setHidden(false);
    form.get('Number of living children').setHidden(false);
    form.get('Number of abortions').setHidden(false);
    form.get('Birth outcome during the last pregnancy').setHidden(false);
    form.get('Place of delivery of the last pregnancy set').setHidden(false);
    if (form.get('Place of delivery of the last pregnancy').getValue() === undefined) {
      form.get('Other Health Centre', 0).setHidden(true);
    } else if (form.get('Place of delivery of the last pregnancy').getValue() === 'Other') {
      form.get('Other Health Centre', 0).setHidden(false);
    } else {
      form.get('Other Health Centre', 0).setHidden(true);
    }
    form.get('Date of most recent pregnancy delivery').setHidden(false);
    form.get('Previous Delivery Complications').setHidden(false);
    if (form.get('Previous Delivery Complications').getValue() === 'Yes') {
      form.get('Previous Delivery Complications Details').setHidden(false);
    }
    form.get('Date of last period').setHidden(false);
    form.get('Estimated date of delivery').setHidden(false);
    form.get('Estimated Gestational Age').setHidden(false);
    form.get('Multiple pregnancy').setHidden(false);
    form.get('Childbirth Plan').setHidden(false);
    if (form.get('Childbirth Plan').getValue() === undefined) {
      form.get('Planned place of delivery set').setHidden(true);
    } else if (form.get('Childbirth Plan').getValue() === 'Yes') {
      form.get('Planned place of delivery set').setHidden(false);
      if (form.get('Planned place of delivery').getValue() === undefined) {
        form.get('Other Health Centre', 1).setHidden(true);
      } else if (form.get('Planned place of delivery').getValue() === 'Other') {
        form.get('Other Health Centre', 1).setHidden(false);
      } else {
        form.get('Other Health Centre', 1).setHidden(true);
      }
    } else {
      form.get('Planned place of delivery set').setHidden(true);
    }

  } else {
    form.get('Number of Pregnancies').setHidden(true);
    form.get('Number of Pregnancies').setValue(undefined);
    form.get('Number of Term Pregnancies').setHidden(true);
    form.get('Number of Term Pregnancies').setValue(undefined);
    form.get('Number of abortions').setHidden(true);
