    form.get('Place of delivery of the last pregnancy set').setHidden(true);
    form.get('Place of delivery of the last pregnancy').setValue(undefined);
    form.get('Other Health Centre', 0).setValue(undefined);

    form.get('Date of most recent pregnancy delivery').setHidden(true);
    form.get('Date of most recent pregnancy delivery').setValue(undefined);

    form.get('Previous Delivery Complications').setHidden(true);
    form.get('Previous Delivery Complications').setValue(undefined);

    form.get('Previous Delivery Complications Details').setHidden(true);
